import React, { useState } from 'react';
import { Card } from 'primereact/card';
import { InputText } from 'primereact/inputtext';
import { Button } from 'primereact/button';
import { Password } from 'primereact/password';
import { TabMenu } from 'primereact/tabmenu';

const LoginPage = () => {
    const [activeIndex, setActiveIndex] = useState(0);
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const items = [
        {label: 'Login', icon: 'pi pi-fw pi-sign-in'},
        {label: 'Sign up', icon: 'pi pi-fw pi-user-plus'}
    ];

    return (
        <div className="flex min-h-screen bg-cyan-50">
            {/* Navigation */}
            <div className="fixed top-0 w-full bg-white shadow-sm">
                <div className="flex justify-between items-center p-4 max-w-7xl mx-auto">
                    <div className="flex items-center gap-8">
                        <div className="text-cyan-600 text-2xl">üè•</div>
                        <div className="hidden sm:flex gap-6">
                            <a href="#" className="text-gray-600 hover:text-cyan-600">Home</a>
                            <a href="#" className="text-gray-600 hover:text-cyan-600">Our products</a>
                            <a href="#" className="text-gray-600 hover:text-cyan-600">About US</a>
                            <a href="#" className="text-gray-600 hover:text-cyan-600">Contact US</a>
                        </div>
                    </div>
                    <Button label="Join" className="bg-cyan-600 border-none hover:bg-cyan-700" />
                </div>
            </div>

            {/* Main Content */}
            <div className="flex-1 flex items-center justify-center p-4 mt-16">
                <div className="w-full max-w-6xl flex justify-between items-center">
                    {/* Login Form */}
                    <Card className="w-full max-w-md shadow-lg">
                        <div className="mb-6">
                            <TabMenu model={items} 
                                    activeIndex={activeIndex} 
                                    onTabChange={(e) => setActiveIndex(e.index)}
                                    className="border-none" />
                        </div>
                        
                        <div className="flex flex-col gap-4">
                            <span className="p-input-icon-left w-full">
                                <i className="pi pi-envelope" />
                                <InputText
                                    value={email}
                                    onChange={(e) => setEmail(e.target.value)}
                                    placeholder="Email or phone number"
                                    className="w-full p-3"
                                />
                            </span>

                            <Password
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}
                                placeholder="Password"
                                toggleMask
                                className="w-full"
                                inputClassName="w-full p-3"
                            />

                            <div className="flex justify-between items-center mt-2">
                                <a href="#" className="text-sm text-cyan-600 hover:text-cyan-700 no-underline">
                                    Forgot your password?
                                </a>
                            </div>

                            <Button 
                                label="Login" 
                                className="w-full mt-4 bg-cyan-500 border-none hover:bg-cyan-600"
                            />
                        </div>
                    </Card>

                    {/* Decorative Image */}
                    <div className="hidden lg:block w-1/2 pl-12">
                        <div className="relative">
                            {/* Laptop Illustration */}
                            <div className="w-64 h-64 bg-cyan-100 rounded-full absolute -z-10 right-0" />
                            <div className="transform rotate-12">
                                <div className="w-48 h-32 bg-white rounded-lg shadow-lg p-2">
                                    <div className="w-full h-full bg-cyan-600 rounded" />
                                </div>
                                <div className="w-48 h-1 bg-gray-200 mt-1" />
                            </div>
                            {/* Plant */}
                            <div className="absolute bottom-0 left-12">
                                <div className="w-8 h-12 bg-green-600 rounded-t-full" />
                                <div className="w-4 h-4 bg-brown-500 mx-auto" />
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default LoginPage;
